import React from "react";
import GroupMember from "./GroupMember";
import { Card } from "reactstrap";
import CustomCollapse from "./CustomCollapse";
import { useTranslation } from "react-i18next";
import { activeChat } from "../data/chat";
interface IProps {
  membersArrayPreventingDuplicateDisplayMember: any;
  toggleCollapse2: any;
  isOpen2: any;
  isAdmin: any;
  defaultAvatar: any;
  participantsArrayPreventingDuplicateDisplayParticipant: any;
}
const MembersOnSideBar: React.FC<IProps> = ({
  isAdmin,
  defaultAvatar,
  membersArrayPreventingDuplicateDisplayMember,
  participantsArrayPreventingDuplicateDisplayParticipant,
  toggleCollapse2,
  isOpen2,
}) => {
  const { t } = useTranslation();
  return (
    <Card className="mb-1 shadow-none border">
      <CustomCollapse
        title={
          t("Members") +
          activeChat.conferenceRoomParticipants ?
          ` (${participantsArrayPreventingDuplicateDisplayParticipant?.length})`
              :
          ` (${membersArrayPreventingDuplicateDisplayMember?.length})`
        }
        iconClass="ri-group-line"
        isOpen={isOpen2}
        toggleCollapse={toggleCollapse2}
      >
        {membersArrayPreventingDuplicateDisplayMember?.map(
          (member: any, i: number) => (
            <GroupMember
              key={i}
              defaultAvatar={defaultAvatar}
              isAdmin={isAdmin}
              member={member}
            />
          )
        )}
      </CustomCollapse>
    </Card>
  );
};

export default MembersOnSideBar;
